-- TRIGGERS


DELIMITER //
CREATE TRIGGER stock_update_after_invoice
AFTER INSERT
ON invoice_details FOR EACH ROW
BEGIN
    UPDATE products
    SET stock = stock - NEW.quantity
    WHERE id = NEW.product_id;
END; //

DELIMITER ;
DELIMITER //
CREATE TRIGGER price_auditing
AFTER UPDATE
ON products FOR EACH ROW
BEGIN
	IF NEW.price <> OLD.price THEN
		`old_price`,
		`new_price`,
		`updated_by`,
		`updated_ts`)
		VALUES
		(NEW.id,
		 OLD.price,
		 NEW.price,
		 USER(),
		 CURRENT_TIMESTAMP());
	END IF;
END; //

DELIMITER ;



-- VIEWS


CREATE OR REPLACE VIEW vw_invoice_details
AS
SELECT 
	IVC_D.invoice_id AS `INVOICE ID`,
    P.name AS `PRODUCT NAME`,
    P.price AS `UNIT COST`,
    IVC_D.quantity AS `QUANTITY`,
    IVC_D.amount AS `AMOUNT`
FROM
    invoice_details IVC_D
        INNER JOIN
    products AS P ON IVC_D.product_id = P.id
;
CREATE OR REPLACE VIEW vw_invoice_headers AS
    SELECT 
        IVC.id AS INVOICE_NUMBER,
        IVC.invoice_date AS DATE_OF_ISSUE,
        IVC.payment_due_date AS PAYMENT_DUE_DATE,
        CONCAT(C.first_name, ' ', C.last_name) AS CLIENT_NAME,
        C.street_address AS CLIENT_ADDRESS,
        C.city AS CLIENT_CITY,
        C.state AS CLIENT_STATE,
        C.country AS CLIENT_COUNTRY,
        C.zip_code AS CLIENT_ZIP_CODE,
        CO.name AS COMPANY_NAME,
        CO.street_address_1 AS COMPANY_STREET_1,
        CO.street_address_2 AS COMPANY_STREET_2,
        CO.phone_number AS COMPANY_PHONE,
        CO.email_address AS COMPANY_EMAIL,
        CO.website AS COMPANY_WEBSITE,
        IVC.total AS MEASURES_TOTAL,
        IVC.subtotal AS MEASURES_SUBTOTAL,
        IVC.discount AS MEASURES_DISCOUNT,
        IVC.tax_rate AS MEASURES_TAX_RATE,
        IVC.tax_amount AS MEASURES_TAX_AMOUNT
    FROM
        invoices IVC
            INNER JOIN
        clients C ON IVC.client_id = C.id
            INNER JOIN
        company CO ON IVC.company_id = CO.id
;
DROP PROCEDURE IF EXISTS UpdateCategoryId ;

DELIMITER //
CREATE PROCEDURE UpdateCategoryId()
BEGIN
	-- Drops the temporary tables being used in the Stored Procedure
	DROP TEMPORARY TABLE IF EXISTS NonLapsedCustomers;
	DROP TEMPORARY TABLE IF EXISTS CategoryAssignment;

	-- Creates a temporary table containing all the customers that have made a purchase in the last 2 months
	CREATE TEMPORARY TABLE NonLapsedCustomers
	SELECT client_id, SUM(total) as TotalSum FROM invoices
	WHERE invoice_date > DATE_SUB(NOW(), INTERVAL 2 MONTH)
	GROUP BY client_id
	;

	-- disable safe update mode
	SET SQL_SAFE_UPDATES=0;

	-- Updates the clients which have no spend in the past 2 months
	UPDATE clients
		SET category_id  = 4
	WHERE id NOT IN (SELECT client_id FROM NonLapsedCustomers);

	-- enable safe update mode
	SET SQL_SAFE_UPDATES=1;


	-- Computes the Average Spend per client in the past 2 months
	SELECT AVG(TotalSum) FROM NonLapsedCustomers INTO @AverageSpend;

	-- Assign a category with the following logic:
	-- 1. Customers with spend below the average
	-- 2. Customers with spend higher than the average and below 2 * Average
	-- 3. Customers with higher than 2*Average spend
	CREATE TEMPORARY TABLE CategoryAssignment
	SELECT 
		*,
		CASE
			WHEN TotalSum < @AverageSpend THEN 1
			WHEN TotalSum >= @AverageSpend AND TotalSum < 2.0 * @AverageSpend THEN 2
			WHEN TotalSum >= 2.0 * @AverageSpend THEN 3
		END AS CategoryId
	FROM NonLapsedCustomers
    ;

	-- Update the client table with the new categories
	UPDATE clients C
	INNER JOIN CategoryAssignment Cat
		ON C.id = Cat.client_id
	SET C.category_id = Cat.CategoryId
	;

END //

DELIMITER ;
CALL UpdateCategoryId();
